import React, {FC} from "react";
import {Item} from "react-photoswipe-gallery";
import 'photoswipe/dist/photoswipe.css'
import 'photoswipe/dist/default-skin/default-skin.css'
import {IPhotoInfo} from "../../interfaces/unsplash.interface";
import {LikeTwoTone} from '@ant-design/icons';

interface IProps {
    data: IPhotoInfo,
}

const Photo: FC<IProps> = ({data}): JSX.Element => {
    const {width, height, urls, liked_by_user} = data;
    const {full, small} = urls;

    return (
        <Item
            original={full}
            thumbnail={small}
            width={width}
            height={height}
        >
            {({ref, open}) => (
                <div className="photo-container" ref={ref as React.MutableRefObject<HTMLImageElement>} onClick={open}
                     style={{backgroundImage: `url(${small})`}}>
                    <div className="photo">
                        <LikeTwoTone style={{ width: '100px', color: '#08c' }} className={`like ${liked_by_user ? 'active' : ''}`}/>
                    </div>
                </div>
            )}
        </Item>
    )
}

export default Photo;
